import React from "react";
import about from "../src/images/about.jpg";


export const About =()=>{
    return(
        <>
       <div className="img-text-wrapper">
        <div className="logo-wrapper">
        <img src={about} />
        </div>
        </div>
        </>
    )
    

};

export default About;
